    [],nt"num_tags": 4,nt"name": "a-narrative-report-mingo-national-wildlife-refuge-sept-through-dec-1947",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Mingo National
    Wildlife Refuge outlines Refuge accomplishments from September through December
    of 1947. The report begins by summarizing the weather conditions, water conditions,
    food and cover, and fire during this period. Wildlife- including migratory birds,
    upland game birds, big game animals, furbearers, predators, rodents, raptors, and
    fish- is also covered. The Refuge development section discusses physical developments
    and plantings. Resource management is outlined; topics include haying and timber
    removal. The public relations section discusses Refuge visitors, Refuge participation,
    hunting, and fishing.  N-R forms and photographs are attached.",nt"owner_org":
